import Icon from "@ant-design/icons";
import {ALERT_TYPE} from "@/pages/RegistrationCenter/AlertManage/AlertInstance/conf";

const svgSize = '100px';

export const getAlertIcon = (type: string) => {
  switch (type) {
    case ALERT_TYPE.DINGTALK:
      return (<Icon component={DingTalkSvg}/>);
    case ALERT_TYPE.WECHAT:
      return (<Icon component={WeChatSvg}/>);
    case ALERT_TYPE.FEISHU:
      return (<Icon component={FeiShuSvg}/>);
    case ALERT_TYPE.EMAIL:
      return (<Icon component={EmailSvg}/>);
    default:
      return (<Icon component={DefaultSvg}/>);
  }
};

